import Grid from '@mui/material/Grid'
import Paper from '@mui/material/Paper'

function DockerStatus({app}) {

  return (
    <Grid container spacing={2} justifyContent="center" display="flex" sx={{ pt: 2 }}>
      <Grid item>
        <Paper elevation={6}>
          {app.State}
        </Paper>
      </Grid>
      <Grid item>
        <Paper elevation={6}>
          {app.Status}
        </Paper>
      </Grid>
    </Grid>
  )
}

export default DockerStatus
